Description:

This sequel to Star Wars Battlefront improves upon its predecessor with a variety of gameplay enhancements, such as upgraded AI, more than 16 new battlegrounds, and greater story emphasis. In addition to the rebel, clone, and droid warriors from the original game, you can play as a Jedi, complete with lightsaber attacks and force powers. Take part in land and space battles from the Star Wars movie series, and pilot a variety of new aircraft, including X-Wings, TIE fighters, and Jedi Starfighters. Star Wars Battlefront also includes online multiplayer modes for battling other gamers.
